import React, { useState } from 'react';
import MainPage from "./小omponents/mainPages/MainPage";
import RegistrationPage from "./小omponents/registrationpage/RegistrationPage";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import "./App.css";


function App() {

  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <Router>
      <Routes>
      <Route path="/" element={<MainPage />} />
        <Route
          path="/r"
          element={isLoggedIn ? <RegistrationPage /> : <MainPage onLogin={handleLogin} />}
        />
      </Routes>
    </Router>
  );
}

export default App;
